import React from 'react'

import {ToastContainer, toast} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function TestToast() {
  const notify = () =>{
    toast("Toast");
  }
  return (
    <div><br/><br/><br/>TestToast
    <button onClick = {notify}></button>
    <ToastContainer/>
    </div>
  )
}

export default TestToast;
